import Link from 'next/link'
import Layout from '../components/layout'
import axios from 'axios'

const mockIndex = [
  {
    title: 'The Federalist Papers',
    url: '/docs/federalist-papers',
  },
  {
    title: 'The Anti-federalist Papers',
    url: '/docs/the-anti-federalist-papers',
  }
];

const IndexPage = ({data}) => (
  <Layout>
    <ul>
      {data.map((doc, index) => {
        const {title} = doc;
        const url = `/docs/${title.toLowerCase().replace(' ', '-')}`;
        return <li key="{index}">
          <Link href={url}>
            <a>{title}</a>
          </Link>
        </li>
      })}
    </ul>
  </Layout>
)

export async function getServerSideProps(ctx) {
  const req = await axios.get(`http://localhost:7687/docs/`);
  const data = req.data;
  return {
    props: {
      data,
    },
  };
}

export default IndexPage
